import "./App.css";
import React from "react";
import { BrowserRouter, Route, Router } from "react-router-dom";
import MainPage from "./pages/MainPage";

function App() {
  return (
    <BrowserRouter className="App">
      <Router path={"/main"}>
        <MainPage />
      </Router>
      <Route path={"/random-table"}></Route>
    </BrowserRouter>
  );
}
export default App;
